@Component({
  selector: 'app-header',
  templateUrl: './header.component.html',
  styleUrls: ['./header.component.css']
})
export class HeaderComponent {

  title: string = 'Bothnia Papers';


}


<header>
<h1>{{title}}</h1>
<app-button color="blue"  text="Click this button!">  </app-button>

</header>
